import "./App.css";
import Login from "./components/Login";
import Navbar from "./components/Navbar";
import { SendReceive } from "./components/SendReceive";
import SentRequests from "./components/SentRequests";
import ReceivedRequests from "./components/ReceivedRequests";
import Requests from "./components/Requests";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"; //used for routing
function App() {
  return (
    <Router>
      <Navbar />
      <div className="App">
        <Switch>
          <Route path="/Home" component={SendReceive} />
          <Route path="/login" component={Login} />
          <Route path="/sentrequests" component={SentRequests} />
          <Route path="/receivedrequests" component={ReceivedRequests} />
          <Route path="/requests" component={Requests} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
